	//////////////////////////RAIN///////////////////////////////////////////////////
var particleSystem;

function WaterDrop( color, rate, minSize,maxsize,file){
// weather REF: https://www.babylonjs-playground.com/#10XN2J#8 ///////////////////////////////////////
            // Create & launch a particule system
              particleSystem = new BABYLON.ParticleSystem("spawnParticles", 3600, scene);    // 3600 particles to have a continue effect when computing circle positions
            particleSystem.particleTexture = new BABYLON.Texture(file, scene);
            particleSystem.color1 = new BABYLON.Color3.FromHexString(color);//new BABYLON.Color4(.9, .9, .95, 1.0);
            particleSystem.color2 =  new BABYLON.Color3.FromHexString(color);//new BABYLON.Color4(0.2, 0.2, .3, .5);
            particleSystem.colorDead = new BABYLON.Color3.FromHexString(color);//new BABYLON.Color4(0, 0, 0.2, 0.0);
            particleSystem.emitter = new BABYLON.Vector3(0, 20, 0);
            particleSystem.minSize = minSize;
            particleSystem.maxSize = maxsize;// this!!
            particleSystem.emitRate = rate;
            particleSystem.blendMode = BABYLON.ParticleSystem.BLENDMODE_ONEONE;     // to manage alpha
            particleSystem.gravity = new BABYLON.Vector3(0, -9.81, 0);
            //particleSystem.direction1 = new BABYLON.Vector3(-1, 1, -1);
            //particleSystem.direction2 = new BABYLON.Vector3(1, 1, 1);
            particleSystem.minEmitPower = -10;
            particleSystem.maxEmitPower = -100;
            //particleSystem.updateSpeed = 0.1;
        
            var radius = 150;
        
            // Custom function to get the circle effect
            particleSystem.startPositionFunction = function(worldMatrix, positionToUpdate)
            {
                var rndAngle = 2 * Math.random() * Math.PI;
                var randX = Math.random() *radius * Math.sin(rndAngle);
                var randY = this.minEmitBox.y;
                var randZ = Math.random() *radius * Math.cos(rndAngle);
                
                BABYLON.Vector3.TransformCoordinatesFromFloatsToRef(randX, randY, randZ, worldMatrix, positionToUpdate);
            }
			
			
            particleSystem.updateFunction = function(particles) {
         for (var index = 0; index < particles.length; index++) {
            var particle = particles[index];
            particle.age += this._scaledUpdateSpeed;
            if (particle.age >= particle.lifeTime) {
                this.recycleParticle(particle);
                index--;
                continue;
            }
            else {
                particle.colorStep.scaleToRef(this._scaledUpdateSpeed, this._scaledColorStep);
                particle.color.addInPlace(this._scaledColorStep);
                if (particle.color.a < 0)
                    particle.color.a = 0;
                particle.angle += particle.angularSpeed * this._scaledUpdateSpeed;
                particle.direction.scaleToRef(this._scaledUpdateSpeed, this._scaledDirection);
                particle.position.addInPlace(this._scaledDirection);
                this.gravity.scaleToRef(this._scaledUpdateSpeed, this._scaledGravity);
                particle.direction.addInPlace(this._scaledGravity);
                 
             }
        }
            };

 
  				
				return particleSystem;
				}
		function setRain()
		{
			
				if(typeof particleSystem !== "undefined"  && particleSystem != null){
	particleSystem.stop();
	particleSystem.dispose();}
	particleSystem=	WaterDrop("#bc153b",50,0.3,0.7,"data:image/png;base64,");
            particleSystem.start();

		}		
